import ReactDOM  from "react-dom";
import React, {useState} from "react";


function App() {
    var count = 0;
    const state = React.useState(43);
    console.log(state);
    function increase() {
        state++;
        ReactDOM.render( <div>
            <button>{state[0]}</button>
            <button onClick={increase}>+</button>
        </div>,
            document.getElementById("root"));
    }
    return (
        <div>
            <button>{count}</button>
            <button onClick={increase}>+</button>
        </div>
    )

}




export default App;
